  false,\n\t\"url\": null,\n\t\"notes\": \"LIDAR data is remotely sensed high-resolution
  elevation data collected by an airborne collection platform. Using a combination
  of laser rangefinding, GPS positioning and inertial measurement technologies; LIDAR
  instruments are able to make highly detailed Digital Elevation Models (DEMs) of
  the earth's terrain, man-made structures and vegetation. This data was collected
  at submeter resolution to provide nominal 1m spacing of collected points. Two returns
  were recorded for each pulse in addition to an intensity value.\",\n\t\"owner_org\":
